import React from 'react'

// import link
import { Link } from 'react-router-dom'
// import images
import intLOGO from '../../assets/images/interactlogo.SVG'
// import components



const Header = () => {
  return (
    <>
    <div className="flex justify-between items-center h-20 px-4">
          {/* logo */}
          <Link to='/homepage'>
            <img src={intLOGO} alt="" />
          </Link>

        {/* Navigations */}
        <div className="container text-center justify-center text-[14px] font-[600]">
          <ul className='gap-6'>
            <Link className='hover:text-greenColor' to='/homepage'>Home</Link>
            <Link className='hover:text-greenColor' to='/homepage'>About</Link>
            <Link className='hover:text-greenColor' to='/homepage'>Activities</Link>
            <Link className='hover:text-greenColor' to='/homepage'>Contact</Link>
          </ul> 
        </div>
        {/* User */}
      <div className="gap-6 font-[600] text-[14px] text-greenColor">
        <span><i class="ri-user-line"></i>@username</span>
        <span><i class="ri-logout-box-line"></i>logout</span>
      </div>
    </div>
    </>
  )
}

export default Header
